import { createClient } from "@supabase/supabase-js";

console.log(
  "WHAT ARE THE VALUES OF THESE TWO??",
  process.env.REACT_APP_SUPABASE_API_URL,
  process.env.REACT_APP_SUPABASE_API_KEY
);

export const client = createClient(
  "https://bpzimtowiyikargwuats.supabase.co",
  `eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9
    .eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImJwemltdG93aXlpa2FyZ3d1YXRzIiwicm9sZSI6ImFub24iLCJpYXQiOjE2ODU3MzIyNDgsImV4cCI6MjAwMTMwODI0OH0
    .Rzs6whzzkZMsilOjfiEoXOYaA3T3pnv1VeRBWufM - A4`
);
